  \"2015-01-22T15:57:53.310978\",\n\t\"name\": \"neighborhood-mapping-tool\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This tool assists the public and Choice
  Neighborhoods applicants to prepare data to submit with their grant application
  by allowing applicants to draw the exact location of their target neighborhood.
  The tool will then calculate the number of housing units, the average poverty rate,
  and the vacancy rate of the area drawn and send an email back to the applicant within
  24 hours. The email will have an attachment containing the necessary data for the
  Choice Neighborhoods application, along with information HUD can use to confirm
  the intended program area. The applicant should then submit this document with their
  grant application as instructed in the NOFA.\",\n\t\"license_title\": \"License
